import{_ as e,o as a,c as r,O as s}from"./chunks/framework.9482e208.js";const h=JSON.parse('{"title":"§ 16.1-69.25 Judge may issue warrants, summons, and subpoenas.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/16.1-69.25.md","filePath":"vacode/16.1-69.25.md"}'),n={name:"vacode/16.1-69.25.md"},t=s('<h1 id="§-16-1-69-25-judge-may-issue-warrants-summons-and-subpoenas" tabindex="-1">§ 16.1-69.25 Judge may issue warrants, summons, and subpoenas. <a class="header-anchor" href="#§-16-1-69-25-judge-may-issue-warrants-summons-and-subpoenas" aria-label="Permalink to &quot;§ 16.1-69.25 Judge may issue warrants, summons, and subpoenas.&quot;">​</a></h1><p>Except as otherwise provided by general law, a judge of a district court may, within the scope of his general jurisdiction, issue warrants, summons, and subpoenas, including subpoenas duces tecum or other process, in civil, traffic and criminal cases, to be returned before his court, and may also issue fugitive warrants and conduct proceedings thereon in accordance with the provisions of §§ <a href="http://law.lis.virginia.gov/vacode/19.2-99/" target="_blank" rel="noreferrer">19.2-99</a> through <a href="http://law.lis.virginia.gov/vacode/19.2-104/" target="_blank" rel="noreferrer">19.2-104</a>.</p><p>1972, c. 708; 1973, c. 546; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0500" target="_blank" rel="noreferrer">500</a>; 2014, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0305" target="_blank" rel="noreferrer">305</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?141+ful+CHAP0310" target="_blank" rel="noreferrer">310</a>.</p>',3),i=[t];function o(c,d,u,l,p,_){return a(),r("div",null,i)}const m=e(n,[["render",o]]);export{h as __pageData,m as default};
